import React, { useEffect } from 'react';
import { useHistory } from 'react-router-dom';
import axios from 'axios';
import { useGlobalState } from './GlobalState';

function OAuthRedirectHandler() {
    const { dispatch } = useGlobalState();
    const history = useHistory();

    useEffect(() => {
        const handleOAuthRedirect = async () => {
            try {
                const response = await axios.get('http://localhost:8080/login/oauth2/code/kakao', {
                    withCredentials: true,
                });
                const userData = response.data;
                console.log('Received user data:', userData); // JSON 데이터를 콘솔에 출력
                dispatch({ type: 'SET_ID', payload: userData.id });
                history.push('/cog-improve-main');
            } catch (error) {
                console.error('OAuth 처리 실패:', error);
            }
        };

        handleOAuthRedirect();
    }, [dispatch, history]);

    return <div>로그인 중...</div>;
}

export default OAuthRedirectHandler;
